import logo from "../../images/argentBankLogo.png";

const Header = () => {
  return (
    <header>
      <nav>
        <Link to="/">
          <img src={logo} alt="Logo ArgentBank" />
        </Link>
      </nav>
    </header>
  );
};

export default Header;
